    ["Year", "Sales", "Expenses", "Profit"],
    ["2014", 1000, 400, 200],
    ["2015", 1170, 460, 250],
    ["2016", 660, 1120, 300],
    ["2017", 1030, 540, 350],
  ];

export const options = {
    chart: {
      title: "Company Performance",
      subtitle: "Sales, Expenses, and Profit: 2014-2017",
    },
  };


const Budget = () => {
    return (
        <div>
            This is the budget page
            <div>
                <Chart 
                chartType='Bar'/>
                data={data}
            </div>
        </div>
    )
}

export default Budget;
